import React from 'react';
import { Navbar, Nav} from 'reactstrap';

export default class Navbare extends React.Component {
  render() {
    return (
      <div>
        <Navbar color="dark" light expand="md">
            <Navbar.Brand href="/">BKK e-Jegy</Navbar.Brand>
        </Navbar>
      </div>
    );
  }
}
